import React from 'react';
import { Row, Col, Typography, Space } from 'antd';
import LoginForm from '../LoginForm/Login.form';

const LoginPage = () => {
  const { Title } = Typography;

  return (
    <>
      <Row justify='center'>
        <Col span={8}>
          <Space direction='vertical'>
            <Title>Login</Title>
          </Space>
          <LoginForm />
        </Col>
      </Row>
    </>
  );
};

export default LoginPage;
